public void testBackslashEscaping() throws IOException {
285: // To avoid confusion over the need for escaping chars in java code,
// We will test with a forward slash as the escape char, and a single
// quote as the encapsulator.
289: final String code =
"one,two,three\n" // 0
+ "'',''\n"       // 1) empty encapsulators
+ "/',/'\n"       // 2) single encapsulators
+ "'/'','/''\n"   // 3) single encapsulators encapsulated via escape
+ "'''',''''\n"   // 4) single encapsulators encapsulated via doubling
+ "/,,/,\n"       // 5) separator escaped
+ "//,//\n"       // 6) escape escaped
+ "'//','//'\n"   // 7) escape escaped in encapsulation
+ "   8   ,   \"quoted \"\" /\" // string\"   \n"     // don't eat spaces
+ "9,   /\n   \n"  // escaped newline
+ "";
final String[][] res = {
{"one", "two", "three"}, // 0
{"", ""},                // 1
{"'", "'"},              // 2
{"'", "'"},              // 3
{"'", "'"},              // 4
{",", ","},              // 5
{"/", "/"},              // 6
{"/", "/"},              // 7
{"   8   ", "   \"quoted \"\" /\" / string\"   "},
{"9", "   \n   "},
};
314: 315: final CSVFormat format = CSVFormat.newBuilder(',').withQuoteChar('\'').withEscape('/')
.withIgnoreEmptyLines(true).withRecordSeparator(CRLF).build();
318: final CSVParser parser = new CSVParser(code, format);
final List<CSVRecord> records = parser.getRecords();
assertTrue(records.size() > 0);
322: Utils.compare("Records do not match expected result", res, records);
}

